import React from 'react';

const CompTime = () => {
  return (
    <div className='now'>

      <time>
        <b>2023</b> -
        <b>12</b> -
        <b>25</b>
        <b>(월)</b>
      </time>

      <time>
        <b>am</b>
        <b>12</b> :
        <b>25</b> :
      </time>

    </div>
  );
};

export default CompTime;
